import React from 'react';

const Card = ({ imageSrc, title, description, link }) => {
  return (
    <div className="card">
      <img src={imageSrc} className="card-img-top" alt={title} />
      <div className="card-body">
        <h6 className="label">
          <a href={link}>{title}</a>
        </h6>
        <p className="card-text">{description}</p>
      </div>
    </div>
  );
};

export default Card;
